import React, { Component, ReactDOM } from 'react';
import logo from '../logo.svg';
//import logo from './logo2.png'
import '../css/App.css';
import '../css/Visual.css';
import  * as vis from 'react-vis-force';

var data;




export class Visual extends Component {

    componentDidMount(){
        // fetch('https://github.com/vasturiano/react-force-graph/blob/master/example/datasets/miserables.json').then(res => res.json()).then(p_data => {
        //     data = p_data;
        // })
        
    }

    
    
    constructor(props){

        super(props);


    }



    render() {

        return (
            <InteractiveForceGraph
                simulationOptions={{ height: 300, width: 300 }}
                labelAttr="label"
                onSelectNode={(node) => console.log(node)}
                highlightDependencies
                >
                <ForceGraphNode node={{ id: 'first-node', label: 'First node' }} fill="red" />
                <ForceGraphNode node={{ id: 'second-node', label: 'Second node' }} fill="blue" />
                <ForceGraphLink link={{ source: 'first-node', target: 'second-node' }} />
            </InteractiveForceGraph>
        )
    }
}
